import React, { useState, useEffect, useRef } from "react";
import "./Home.css";

const Home = () => {
  const [currentImage, setCurrentImage] = useState(0);
  const carouselImages = [
    "/images/slide1.jpg",
    "/images/slide2.jpg",
    "/images/slide3.jpg",
  ];

  const serviceRef = useRef();
  const aboutRef = useRef();

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentImage((prev) => (prev + 1) % carouselImages.length);
    }, 4000);
    return () => clearInterval(interval);
  }, []);

  const scrollToRef = (ref) => {
    ref.current.scrollIntoView({ behavior: "smooth" });
  };

  const services = [
    { name: "Dry Massage", price: "1500" },
    { name: "Aroma Oil Massage", price: "2000" },
    { name: "Cream Massage", price: "2500" },
    { name: "Mintjel Massage", price: "2500" },
    { name: "Chocolate Massage", price: "3000" },
    { name: "Deep Tissue Massage", price: "3000" },
    { name: "Thai Massage", price: "4000" },
    { name: "Hand Massage", price: "4000" },
  ];

  return (
    <div className="home">

      {/* Header Section */}
      <header className="header animate-fade">
        <div className="logo">
          <h1>Midnight Spa ✨</h1>
        </div>
        <div className="header-info">
          <p className="special-offer">Only ₹1199/- | 30+15 = 45 mins</p>
          <p>👩 STAFF: North East & Local</p>
          <p>🧖 Includes Shower</p>
          <p>📍 Bhatkhedi Chourha, Opp BS Hospital</p>
          <p>📞 8878873358 | 8871216273</p>
          <div className="nav-buttons">
            <button onClick={() => scrollToRef(serviceRef)}>Services</button>
            <button onClick={() => scrollToRef(aboutRef)}>About</button>
          </div>
        </div>
      </header>

      {/* Main Carousel */}
      <div className="carousel animate-slide">
        <img
          src={carouselImages[currentImage]}
          alt="carousel"
          className="carousel-image"
        />
        <div className="carousel-nav">
          {carouselImages.map((_, index) => (
            <span
              key={index}
              className={`dot ${index === currentImage ? "active" : ""}`}
              onClick={() => setCurrentImage(index)}
            ></span>
          ))}
        </div>
      </div>

      {/* Services Section */}
      <section className="services section" ref={serviceRef}>
        <h2 className="section-title">💆 Massage Services</h2>
        <div className="service-grid">
          {services.map((s, i) => (
            <div key={i} className="service-card animate-zoom">
              <h3>{s.name}</h3>
              <p>₹ {s.price}</p>
            </div>
          ))}
        </div>
      </section>

      {/* Offers Section */}
      <section className="offers animate-pop">
        <h2>💫 Special Offers</h2>
        <p>Get 45 minutes of bliss for only ₹1199!</p>
        <button className="book-btn">Book Now</button>
      </section>

      {/* About Section */}
      <section className="about section animate-fade" ref={aboutRef}>
        <h2>About Us</h2>
        <p>
          At Midnight Spa, we blend comfort, care, and professionalism to offer
          an experience like no other. Choose from a variety of massages and
          treatments tailored to relieve stress and rejuvenate your body.
        </p>
      </section>

      {/* Triple Image Slider */}
      <div className="three-carousel section animate-slide">
        <img src="/images/slider1.jpg" alt="" />
        <img src="/images/slider2.jpg" alt="" />
        <img src="/images/slider3.jpg" alt="" />
      </div>

      {/* Contact Us Section */}
      <section className="contact section animate-zoom">
        <h2>📬 Contact Us</h2>
        <form className="contact-form">
          <input type="text" placeholder="Name" required />
          <input type="email" placeholder="Email" required />
          <textarea placeholder="Message" rows="4" required></textarea>
          <button type="submit">Send</button>
        </form>
      </section>

      {/* Footer */}
      <footer className="footer">
        <p>© 2025 Midnight Spa | Designed with ❤️</p>
      </footer>
    </div>
  );
};

export default Home;
